        <style data-savepage-href=&quot;css/24_news.css&quot; type=&quot;text/css&quot;>    .tabs ul {
    max-width: 1180px;
    margin: 30px auto 20px;
    padding-left: 0;
    border-bottom-color: #d4d4d4
}

.tabs ul li a {
    display: inline-block;
    padding: 6px 12px;
    border-bottom-color: #d4d4d4;
    background: #d4d4d4;
    color: #575757;
    position: relative;
    top: 1px
}

.tabs ul li a.active {
    color: #191d30
}

.tabs+.profile {
    width: 100%;
    max-width: 1180px;
    margin: 0 auto;
    background: #fff
}

#user-login,
#user-register-form,
#user-pass {
    max-width: 1180px;
    margin: 0 auto 40px;
    color: #191d30
}

#user-login input,
#user-register-form input,
#user-pass input {
    width: 200px;
    padding: 0 5px;
    line-height: 36px;
    border: 1px solid #d4d4d4;
    background: #fff
}

#user-login input[type=submit],
#user-register-form input[type=submit],
#user-pass input[type=submit] {
    width: auto;
    padding: 0 20px;
    border: 0;
    color: #fff;
    font-size: 16px;
    background: #00b4ff
}

#user-login input[type=submit]:hover,
#user-register-form input[type=submit]:hover,
#user-pass input[type=submit]:hover {
    background: #00a8e2
}

.form-item {
    margin: 20px 0
}

.form-item label {
    display: inline-block;
    width: 150px
}

#user-pass .form-item label {
    width: 300px
}

#user-login .description {
    display: none
}

#user-login input:-webkit-autofill,
#user-register-form input:-webkit-autofill,
#user-pass input:-webkit-autofill {
    -webkit-box-shadow: 0 0 0 1000px #fff inset
}

@media screen and (max-width:1200px) {
    .tabs,
    .tabs+.profile,
    #user-login,
    #user-register-form,
    #user-pass {
        padding: 0 10px
    }
}

#wrapper-footer {
    padding: 40px 2.5% 0;
    text-align: left;
    max-width: 1200px;
    margin: 0 auto
}

#wrapper-footer a {
    text-decoration: none
}

#wrapper-footer .wrapper {
    max-width: 1200px;
    margin: 0 auto
}

#wrapper-footer .on-hover {
    display: none
}

#wrapper-footer a:hover>.off-hover {
    display: none
}

#wrapper-footer a:hover>.on-hover {
    display: inline
}

.box-left {
    float: left;
    width: 75%;
    padding: 0
}

.box-right {
    float: left;
    width: 25%
}

.box-left .panel-footer {
    float: left;
    width: 23%;
    margin-right: 2%;
    margin-bottom: 5%
}

.ie7 .box-left .panel-footer {
    width: 22%
}

.panel-footer.first-desktop {
    clear: left
}

.panel-footer,
.panel-footer a {
    color: #fff
}

.panel-footer h3 {
    font-weight: 400;
    margin-bottom: 22px
}

.panel-footer ul {
    padding: 0;
    margin: 0;
    list-style: none none
}

.panel-footer ul li {
    padding: 0;
    margin: 10px 0;
    list-style: none none
}

.panel-footer div.w_1of2 {
    float: left;
    width: 50%;
    padding: 7% 0
}

.ie7 .panel-footer div.w_1of2 {
    width: 49%
}

.panel-footer div.w_1of2.first {
    clear: left
}

.panel-footer div.w_1of4 {
    float: left;
    width: 20%;
    padding-left: 0;
    padding-right: 0;
    margin: 0 1%
}

.panel-footer div.w_1of4 img {
    width: 50px!important
}

.panel-footer div.w_1of4.first {
    clear: left;
    padding-left: 0
}

.panel-footer div.w_1of4.last {
    padding-right: 0
}

.panel-footer div.aplikace {
    padding: 0 0 5%
}

.panel-footer hr {
    border: 0;
    border-top: 1px solid #595856
}

.footer-social p {
    color: #aaa
}

#wrapper-copyright {
    background: #3c3c3c /*savepage-url=../images/wrapper-copyright.png*/ url() repeat 0 0;
    min-width: 980px;
    padding-top: 10px
}

#wrapper-copyright .f-left {
    width: 50%;
    text-align: left;
    padding-left: 2.5%
}

#wrapper-copyright .f-right {
    float: right;
    width: 50%;
    text-align: right;
    padding-right: 2.5%
}

#wrapper-copyright #copyright {
    visibility: hidden
}

#copyright a {
    color: #acacac
}

@media(min-width:0) {
    #wrapper-footer {
        min-width: 0!important
    }
}

@media(min-width:481px) and (max-width:979px) {
    .box-left,
    .box-right {
        float: none;
        width: auto;
        padding: 0
    }
    .box-left .panel-footer {
        width: 22%;
        margin-right: 0;
        margin-left: 3%
    }
    .panel-footer.first-desktop {
        width: 25%;
        margin-left: 0
    }
    .panel-footer div.w_1of2 {
        width: 50%
    }
    .footer-search,
    .footer-social {
        float: right;
        width: 40%
    }
    .footer-channels {
        float: left;
        width: 50%
    }
}

@media(min-width:481px) and (max-width:720px) {
    .footer-search,
    .footer-social {
        width: 40%
    }
    .panel-footer div.w_1of4 {
        width: 50px;
        padding-left: 0;
        padding-right: 0;
        margin-right: 20%
    }
    .panel-footer div.w_1of4.last {
        margin-right: 0
    }
}

@media(max-width:480px) {
    #wrapper-footer {
        padding-top: 30px
    }
    .box-left,
    .box-right {
        padding: 0 8%
    }
    .box-left,
    .box-right,
    .box-left .panel-footer,
    .box-right .panel-footer {
        float: none;
        width: auto;
        margin-bottom: 0;
        margin-left: 0;
        margin-right: 0
    }
    .footer-search {
        margin-bottom: 30px
    }
    .footer-social {
        text-align: center
    }
    .panel-footer div.w_1of4 {
        width: 22%;
        padding-left: 0;
        padding-right: 0;
        margin: 0 1%
    }
    .panel-footer div.w_1of4 img {
        width: 50px!important
    }
    .panel-footer div.w_1of4.first {
        padding-left: 0
    }
    .panel-footer div.w_1of4.last {
        padding-right: 0
    }
    .panel-footer h3 {
        margin-bottom: 10px
    }
    .panel-footer ul {
        margin-bottom: 30px
    }
}

@media(min-width:0) {
    #wrapper-copyright {
        min-width: 0!important
    }
}

@media(max-width:480px) {
    #copyright {
        width: auto;
        padding: 20px 5%
    }
    #copyright .f-left,
    #copyright .f-right {
        float: none;
        width: 100%;
        padding: 5px 0;
        text-align: center
    }
}

html {
    line-height: 1.15;
    -webkit-text-size-adjust: 100%
}

body {
    margin: 0
}

main {
    display: block
}

h1 {
    font-size: 2em;
    margin: .67em 0
}

hr {
    box-sizing: content-box;
    height: 0;
    overflow: visible
}

pre {
    font-family: monospace, monospace;
    font-size: 1em
}

a {
    background-color: transparent
}

abbr[title] {
    border-bottom: 0;
    text-decoration: underline;
    text-decoration: underline dotted
}

b,
strong {
    font-weight: bolder
}

code,
kbd,
samp {
    font-family: monospace, monospace;
    font-size: 1em
}

small {
    font-size: 80%
}

sub,
sup {
    font-size: 75%;
    line-height: 0;
    position: relative;
    vertical-align: baseline
}

sub {
    bottom: -.25em
}

sup {
    top: -.5em
}

img {
    border-style: none
}

button,
input,
optgroup,
select,
textarea {
    font-family: inherit;
    font-size: 100%;
    line-height: 1.15;
    margin: 0
}

button,
input {
    overflow: visible
}

button,
