.calendar {
    background-color: #f2f5fd;
    background-image: -webkit-linear-gradient(left, #d2defe 0, #f0fbff 100%);
    background-image: linear-gradient(to right, #d2defe 0, #f0fbff 100%);
    position: relative;
    padding: 32px 36px 0
}

.calendar:after {
    content: ' ';
    position: absolute;
    right: 0;
    bottom: 0;
    left: 0;
    height: 2px;
    background-color: #00b4ff;
    background-image: -webkit-linear-gradient(left, #1250cc 0, #00beff 75%, #00beff 100%);
    background-image: linear-gradient(to right, #1250cc 0, #00beff 75%, #00beff 100%)
}

.calendar-title {
    margin: 23px 0 32px;
    line-height: 30px;
    font-size: 20px;
    font-family: tv sans screen, Helvetica, Arial, sans-serif;
    color: #666e7a
}

.calendar-nav {
    position: relative
}

.calendar-next,
.calendar-prev {
    position: absolute;
    top: 0;
    bottom: 0;
    display: block;
    margin: auto;
    width: 8px;
    height: 15px;
    text-indent: 100%;
    white-space: nowrap;
    overflow: hidden;
    background: /*savepage-url=../images/arrow-right-gray.svg*/ url() no-repeat center center
}

.calendar-next:hover,
.calendar-prev:hover {
    background-image: /*savepage-url=../images/arrow-right-blue.svg*/ url()
}

.no-svg .calendar-next,
.no-svg .calendar-prev {
    background-image: /*savepage-url=../images/arrow-right-gray.png*/ url()
}

.no-svg .calendar-next:hover,
.no-svg .calendar-prev:hover {
    background-image: /*savepage-url=../images/arrow-right-blue.png*/ url()
}

.calendar-prev {
    left: 0;
    transform: rotate(180deg)
}

.calendar-next {
    right: 0
}

.calendar-month {
    display: block;
    line-height: 29px;
    text-align: center;
    font-size: 20px;
    font-family: tv sans screen, Helvetica, Arial, sans-serif;
    font-weight: 400;
    color: #1250cc
}

.calendar-items {
    padding: 0
}

.calendar-itm {
    display: block;
    position: relative;
    padding: 25px 0 22px 46px;
    list-style: none;
    border-top: 1px solid #ededee
}

.calendar-itm:before {
    content: attr(data-monthday);
    display: block;
    width: 24px;
    height: 24px;
    position: absolute;
    top: 25px;
    left: 0;
    line-height: 31px;
    text-align: center;
    font-family: tv sans screen, Helvetica, Arial, sans-serif;
    font-size: 12px;
    color: #666e7a;
    background: /*savepage-url=../images/calendar-day.svg*/ url() no-repeat center center
}

.no-svg .calendar-itm:before {
    background-image: /*savepage-url=../images/calendar-day.png*/ url()
}

.calendar-itm-date {
    display: block;
    padding-bottom: 7px;
    line-height: 1;
    font-size: 12px;
    font-family: tv sans screen, Helvetica, Arial, sans-serif;
    text-transform: uppercase;
    color: #666e7a
}

.calendar-itm-title {
    margin: 0;
    padding-bottom: 0;
    line-height: 24px;
    font-size: 18px;
    font-family: tv sans screen, Helvetica, Arial, sans-serif;
    color: #1250cc
}

.calendar-itm-desc {
    display: none;
    margin: 0;
    line-height: 24px;
    font-size: 18px;
    color: #666e7a
}

.calendar-monthview {
    position: relative;
    display: none;
    margin: 22px -16px -18px;
    width: calc(100% + 32px);
    border-spacing: 1px;
    border-collapse: collapse;
    z-index: 10;
    table-layout: fixed
}

.calendar-monthview td {
    background: #f2f5fd;
    position: relative;
    width: 14.285714%;
    height: 0;
    padding-bottom: 14.285714%;
    text-align: center;
    color: #666e7a;
    font-family: tv sans screen, Helvetica, Arial, sans-serif;
    line-height: 1;
    border: 1px solid transparent
}

.calendar-monthview td i {
    font-style: normal;
    position: absolute;
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
    margin: auto;
    font-size: 14px;
    height: 14px
}

.calendar-monthview td.nn {
    background: 0 0
}

.calendar-monthview td.in {
    background: #1250cc;
    color: #fff
}

.calendar-monthview td.un:after {
    content: &quot;&quot;;
    position: absolute;
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
    border: 1px solid #1250cc
}

.calendar-monthview td.un i {
    color: #1250cc
}

.calendar-monthview td.un i:after {
    content: &quot;&quot;;
    position: absolute;
    margin: auto;
    width: 2px;
    height: 2px;
    background: #1250cc;
    left: 0;
    right: 0;
    bottom: -2px
}

