.navigation {
    font-family: tv sans screen, Helvetica, Arial, sans-serif;
    font-size: 16px
}

.navigation-toggle {
    display: inline-block;
    margin-left: 10px;
    padding: 0 9px;
    line-height: 27px;
    font-size: 13px;
    text-transform: uppercase;
    text-decoration: none;
    background: #0e41a4;
    background: rgba(14, 65, 164, .64);
    color: #fff;
    min-height: 0;
    transition: all .25s ease-out .25s;
    border-radius: 4px
}

