    margin: 0;
    padding: 0;
    display: inline;
    font-size: inherit;
    font-family: inherit;
    color: inherit;
    line-height: inherit
}

.navigation-toggle .shape {
    display: none
}

.navigation-bottom {
    clear: both
}

.navigation-heading {
    display: block;
    background: #277ae5;
    color: #d6f4ff;
    position: relative;
    z-index: 1;
    line-height: 1;
    padding: 26px 0 9px 20px;
    text-transform: uppercase
}

.navigation-heading:after {
    display: block;
    height: 1px;
    background: #4694ca;
    position: absolute;
    top: 8px;
    right: 20px;
    left: 20px;
    content: ''
}

.navigation-count {
    display: inline-block;
    padding: 2px 7px;
    background-color: #d6f4ff;
