    line-height: 28px;
    font-size: 18px;
    font-family: inherit;
    color: #282d4d;
    vertical-align: top;
    padding-left: 30px
}

.form-checkbox label:before,
.form-radio label:before {
    display: inline-block;
    vertical-align: top;
    content: '';
    position: absolute;
    left: 0;
    top: 0;
    margin-top: 4px;
    margin-right: 12px;
    width: 20px;
    height: 20px;
    border: 2px solid #b2b6bc;
    transition: border-color .25s ease;
    background: #fff
}

