}

.form-checkbox input:checked+label:hover:before,
.form-radio input:checked+label:hover:before {
    border-color: #00abe6;
    background-position: -22px center
}

.form-checkbox input:checked+label .shape-tick,
.form-radio input:checked+label .shape-tick {
    display: inline-block
}

.form-radio label:before {
    border-radius: 20px
}

.form-radio .shape-radio {
    display: none;
    width: 8px;
    height: 8px;
    position: absolute;
    left: 6px;
    top: 10px;
    background: #00beff;
    border-radius: 8px
