        line-height: 1.5!important
    }
    .article-meta {
        font-size: 12pt!important
    }
    .recommended-item-wrapper {
        padding-bottom: 0!important
    }
    .recommended-item-wrapper a:after {
        display: block!important
    }
    .recommended-item-wrapper .related-item {
        margin-bottom: 0!important
    }
    .mainarticle-title {
        font-size: 14pt!important;
        line-height: 1.5!important
    }
    .mainarticle-title a:after {
        display: block!important
    }
    .timestamp-postfix,
    .timestamp-prefix {
        display: block!important;
        font-size: 8pt!important
    }
    .mainarticle-meta-timestamp .timestamp-postfix {
        font-family: source sans pro, sans-serif!important
    }
    .homepage-header {
        padding-top: 20px!important
    }
    .fact,
    .poll,
    .profile,
    .recommended {
        page-break-inside: avoid
    }
    .recommended {
        clear: both!important
    }
    .label {
        font-size: 8pt!important;
        font-weight: 400!important;
        border-color: #7b8594!important;
        color: #000
    }
    .position-P {
        margin-right: 0!important;
        padding-top: 0!important
    }
    .fact.view-collapse,
    .poll .panel {
        display: none!important
    }
    .fact.view-collapse.is-open,
    .poll .panel.is-open {
        display: block!important
    }
    .panel-bar {
        padding: 0!important
    }
    .panel-bar-label,
    .panel-bar-title {
        float: none!important
    }
    .panel-bar-title {
        display: 100%
    }
    .fact-title,
    .poll-header .poll-question,
    .profile-name {
        font-size: 12pt!important
    }
    .fact-list li,
    .poll-vote,
    .profile-text>p {
        font-size: 10pt!important
    }
    .panel-content,
    .poll-details {
        padding: 0!important;
        -webkit-transition: none!important;
        transition: none!important
    }
    .poll-header,
    .profile-header,
    .profile-text {
        padding: 0!important
    }
    .profile-image img {
        visibility: visible
    }
    .profile-image {
        margin: 0 10px 10px 0!important
    }
    .profile-label {
        margin-top: 0!important
    }
    .poll {
        padding: 0!important
    }
    .poll-vote {
        padding: 0!important
    }
    .poll-percentage {
        position: static!important
    }
    .poll-progress {
        margin-top: 3px!important
    }
    .poll-vote {
        margin: 10px 0 0!important
    }
    .form-item {
        margin: 0!important
    }
    .panel.is-open .panel-content {
        padding: 0!important
    }
}

.weather-header {
    background-color: #f2f5fd;
    *zoom: 1;
    filter: progid:DXImageTransform.Microsoft.gradient(gradientType=1, startColorstr='#FFF2F5FD', endColorstr='#FFE2F8FF');
    background-image: url(data:image/svg+xml;base64,);
    background-size: 100%;
    background-image: -webkit-gradient(linear, 0% 50%, 100% 50%, color-stop(0%, #f2f5fd), color-stop(100%, #e2f8ff));
    background-image: -moz-linear-gradient(left, #f2f5fd 0, #e2f8ff 100%);
    background-image: -webkit-linear-gradient(left, #f2f5fd 0, #e2f8ff 100%);
    background-image: linear-gradient(to right, #f2f5fd 0, #e2f8ff 100%)
}

